import React, { Component } from "react";
import "./App.css";
import SignupCreds from "./Views/signupPage";
import LoginCreds from "./Views/loginPage";
import Homepage from "./Views/homePage";
import ContactUs from "./Components/contactUsForm";
import headerBar from "./Components/headerBar";
import "bootstrap/dist/css/bootstrap.css";
import "shards-ui/dist/css/shards.min.css";
import { Route, Link, BrowserRouter as Router, Switch } from "react-router-dom";
import {
  Navbar,
  NavbarToggler,
  NavbarBrand,
  Nav,
  NavItem,
  NavLink,
  Dropdown,
  DropdownToggle,
  DropdownMenu,
  DropdownItem,
  InputGroup,
  InputGroupAddon,
  InputGroupText,
  FormInput,
  Collapse
} from "shards-react";

class App extends Component {
  render() {
    return (
      <Router>
        <div className="App">
          <Navbar type="dark" theme="primary" expand="md">
            <NavbarBrand href="#">Shards React</NavbarBrand>

            <Nav navbar>
              <NavItem>
                <NavLink active href="/login">
                  Login
                </NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="/signup">Sign Up</NavLink>
              </NavItem>
              <NavItem>
                <NavLink href="/contactus">Contact Us</NavLink>
              </NavItem>
            </Nav>

            <Nav navbar className="ml-auto">
              <InputGroup size="sm" seamless>
                <InputGroupAddon type="prepend" />
                <FormInput className="border-0" placeholder="Search..." />
              </InputGroup>
            </Nav>
          </Navbar>
          {/* <Switch>
            <Route path="/login" component={LoginCreds} />
            <Route path="/contactus" component={ContactUs} />
            <Route path="/signup" component={SignupCreds} />
          </Switch> */}
        </div>
      </Router>
    );
  }
}

export default App;
